import React, { useState, useEffect } from 'react';
import { getUsers } from '../api/userApi';

function UserList() {
    const [users, setUsers] = useState([]);

    useEffect(() => {
        async function fetchUsers() {
            try {
                const usersData = await getUsers();
                setUsers(usersData);
            } catch (error) {
                console.error('Error fetching users:', error);
            }
        }
        fetchUsers();
    }, []);

    return (
        <div>
            <h1>Admin Page</h1>
            <table>
                <thead>
                    <tr>
                        <th>Customer</th>
                        <th>Company</th>
                        <th>Admission Status</th>
                    </tr>
                </thead>
                <tbody>
                    {users.map((user, index) => (
                        <tr key={index}> {/* Utilisation de l'index comme cl√© */}
                            <td key={`${user.id}-username`}>{user.username}</td>
                            <td key={`${user.id}-company`}>{user.profile.company}</td>
                            <td key={`${user.id}-status`}>{user.validation.is_validated ? 'Accepted' : 'Pending'}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default UserList;
